        await axios.get('/apis/v1/product/' + match.params.number).then(res=> {
            Setproduct(res);
            console.log(product)
        })
    }

    useEffect(()=>{
        fetchProduct()

    },[match.params.number])

    return(

        <Container>

            <ListGroup>
            <ListGroup.Item>Cras justo odio</ListGroup.Item>
